define("js/json/constants",[],function(){return{openCourses:["calculus1","childnutrition","competitivestrategy","sustainabledevelopment1","chineseforbeginners","ageofjefferson","epidemiology","kennedy","publicspeaking","businessinsociety","togetherteacher","competitivestrategyzh","financialengineering1","financialengineering2","insidetheinternet","advancedchemistry"],pinnedCourses:["publicspeaking"],specializationsFlaggedForNoPayment:["businessoperations","digitalmarketing","interactiondesign","projectmanagement","bizcommunication","managementbasics","biztools","engineeringgraphics","compsci","socialscience"],topicsFlaggedForNoPayment:["foundationmedneuro"],specializationsFlaggedForPriceChange:["jhudatascience","genomics"],chineseOnlyTopicToCourses:{datascitoolbox:[973978,973979,973980,974721,974722],rprog:[973973,973974,973975,973976,973977],getdata:[974176,974764,974770,974771,974772],exdata:[974177,974765,974766,974767,974768]},flexjoin_course_ids:[970641,972058,971830,971921,971981,972197,972476,972475,972296,972242,972189,972750,972893,972894,972895,971772,970726,972974,972902,971727,971558,972832,972560,972196,971211,971994,973098,5e6,5000001],student_stories_topics:{88:[{text:"I've begun using Python for data analysis. My Certificate not only gave me commitmment to complete the course but also something to highlight in school applications.",student:"Timothy W.",title:"Business Analyst at Boeing"},{text:"The course material made me a better data analyst. I was able to get a promotion and raise within weeks of completing my first course. I am just thrilled!",student:"Corey K.",title:"IT & Support Professional"},{text:"I needed to upgrade my programming skills to cope with the ever-increasing software-defined infrastructure in the industry. I know the Course Certificate will help my career.",student:"Bernard T.",title:"Hardware Engineer at Cisco"},{text:"I took this course to better prepare myself for upcoming projects at work. The Certificate helps to verify my effort. It reassures my employer that I‚Äôm capable to take on Python-related tasks.",student:"Andy L.",title:"Systems Administrator - Florida Museum of History"}],168:[{text:"The course improved my knowledge in the field, and the Course Certificate gives me a lot more credibility.",student:"Clayton S.",title:"Business Development Manager"},{text:"I'm using what I learned in the course to develop new products in my company, one of the oldest and most respected newspapers in Brazil.",student:"Nelson P.",title:"CIO from Brazil"},{text:"After the course, I was inspired to write the business plan for my start-up. My certificate proves what I‚Äôve accomplished!",student:"Florian A.",title:"Account Manager from Switzerland"},{text:"By showing my Course Certificate to my employer, I was able to get support to turn my idea into a new project.",student:"Sebastian S.",title:"Programmer from Costa Rica"}],747:[{text:"This course helped me identify a target market and understand aspects of marketing that I hadn't been aware of, and for that I am grateful. I'll use the certificate I received from Coursera as a seal of approval for my work.",student:"Bartholomew N.",title:"Director of Fundraising at WQED in Pittsburgh, PA"},{text:"The course validated the analytics functions we‚Äôve instituted within our company. And the Course Certificate validates my skill set.",student:"Michael D.",title:"Director of Sales from Portland"},{text:"Learning is a never-ending process. Now I know what needs to get done before I start rebranding my company.",student:"Saundra L.",title:"CEO from Miami, Florida"},{text:"My employers were happy to hear that I'd completed the course. The Course Certificate shows my dedication to performing better at my current position.",student:"Stephanie N.",title:"Marketing Communications Manager from Newark, Delaware"}]}}});
